// src/components/Profile.js
import React, { useState } from 'react';
import './Profile.css';

const Profile = () => {
  const [selectedMenu, setSelectedMenu] = useState('My Programs');

  const handleMenuItemClick = (menu) => {
    setSelectedMenu(menu);
  };

  return (
    <div className="profile-page">
      <div className="sidebar">
        <ul>
          <li onClick={() => handleMenuItemClick('Your Profile')}>Your Profile</li>
          <li onClick={() => handleMenuItemClick('My Programs')}>My Programs</li>
          <li onClick={() => handleMenuItemClick('My Diet Plans')}>My Diet Plans</li>
          <li onClick={() => handleMenuItemClick('My Articles')}>My Articles</li>
          <li onClick={() => handleMenuItemClick('My Medical History')}>My Medical History</li>
          <li onClick={() => handleMenuItemClick('My Progress')}>My Progress</li>
          <li onClick={() => handleMenuItemClick('My Trainer')}>My Trainer</li>
          <li onClick={() => handleMenuItemClick('My Subscription')}>My Subscription</li>
        </ul>
      </div>

      <div className="profile-content">
        <div className="profile-header">
          <div className="profile-pic">
            <img src="p.jpg" alt="Profile" />
          </div>
          <h2>Welcome, User!</h2>
        </div>

        <div className="content">
          {selectedMenu === 'My Programs' && (
            <div className="programs">
              <img src="v1.jpg" alt="Program 1" className="program-img" />
              <img src="v2.jpg" alt="Program 2" className="program-img" />
              <img src="v3.jpg" alt="Program 3" className="program-img" />
            </div>
          )}

          {/* You can add content for other menu items here */}
          {selectedMenu === 'Your Profile' && <div>Your Profile Content</div>}
          {selectedMenu === 'My Diet Plans' && <div>My Diet Plans Content</div>}
          {selectedMenu === 'My Articles' && <div>My Articles Content</div>}
          {selectedMenu === 'My Medical History' && <div>My Medical History Content</div>}
          {selectedMenu === 'My Progress' && <div>My Progress Content</div>}
          {selectedMenu === 'My Trainer' && <div>My Trainer Content</div>}
          {selectedMenu === 'My Subscription' && <div>My Subscription Content</div>}
        </div>
      </div>
    </div>
  );
};

export default Profile;
